-- ----------------------------
-- Procedure structure for GetSerialNo
-- ----------------------------
DROP PROCEDURE IF EXISTS `GetSerialNo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `GetSerialNo`(IN v_code VARCHAR(10), IN v_nowdate VARCHAR(20), OUT result VARCHAR(20) )
BEGIN

    DECLARE  v_serial_no	INT;

	DECLARE t_error INTEGER DEFAULT 0;

    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;



    START TRANSACTION;

	update pf_sm_serial_no set serial_no = serial_no where code = v_code and busi_date = v_nowdate;

	SELECT serial_no INTO v_serial_no FROM pf_sm_serial_no WHERE code = v_code and busi_date = v_nowdate;

	IF v_serial_no IS NULL THEN

		set v_serial_no = 1;


	ELSE

		set v_serial_no = v_serial_no + 1;

		update pf_sm_serial_no set serial_no = v_serial_no where code = v_code and busi_date = v_nowdate;

	END IF;

	SELECT lpad(v_serial_no, 4, '0') INTO result;

	

	IF t_error =1 THEN

		ROLLBACK;

		SET result = 'Error';

	ELSE

		COMMIT;

	END IF;

	

	SELECT  result;

END
;;
DELIMITER ;

